    const [header,setHeader] = useState(props.header);

    return <div style={{backgroundImage:monitor}} class="Card">
        <h3>{header}</h3>
       
        <Auxillary/>
        <h4 >Front-End</h4>
        <h4 >Middle Layer</h4>
        <h4 >Back-End</h4>
    </div>;
}


export default Card;
